def dateGetter(calendar):

    startTimeList = []
    endTimeList = []

    for event in calendar:

        s = event['start'].get('dateTime', event['start'].get('date'))
        e = event['end'].get('dateTime', event['end'].get('date'))

        startD  = date(int(s[:4]), int(s[5:7]), int(s[8:10]))
        startT = time(int(s[-14: -12]), int(s[-11: -9]))

        endD  = date(int(e[:4]), int(e[5:7]), int(e[8:10]))
        endT = time(int(e[-14: -12]), int(e[-11: -9]))

        startDateTime = datetime.combine(startD, startT)
        endDateTime = datetime.combine(endD, endT)

        startTimeList.append(startDateTime)
        endTimeList.append(endDateTime)

    finalList = [startTimeList, endTimeList]
    return finalList

def freeTimeFinder(calendar):
    events = dateGetter(calendar)
    list_of_available_time = []

    for i in range(len(events[0])-1):
        start_times = events[0]
        end_times = events[1]

        if(end_times[i].time() > start_times[i+1].time()) :
            continue
        else :
            if(end_times[i].date() != start_times[i+1].date()):
                continue
            else :
                tuple_of_time = [end_times[i].date(), end_times[i].time(), start_times[i+1].time()]
                list_of_available_time.append(tuple_of_time)

    return list_of_available_time

